import React from 'react';
import{ Container,Breadcrumb,Row, Col} from "react-bootstrap";

function App(){
  return(
    <Container>
    <Breadcrumb>
      <Breadcrumb.Item href="https://react-bootstrap.github.io">Website React Bootstrap</Breadcrumb.Item>
    </Breadcrumb>
    <Row>
      <Col>Kolom 1</Col>
      <Col>Kolom 2</Col>
    </Row>
    </Container>
  );
}

export default App;
